  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      <main>
        <h1> { textJSX }</h1>
        <h2>It is {new Date().toLocaleTimeString('pt', { hour12: true })}.</h2>
      </main>
      </header>

    </div>
  );
}

export default App;
